INSERT INTO `news` VALUES (1,'普陀羽毛球馆新增免费教练通知','羽毛球运动隔网对垒，可以避免身体碰撞时造成的不必要伤害，并且可快可慢，可张可弛，身体各部分协调运动，各肌肉得到充分锻炼，最重要的是使运动者不再面对冰冷的健身器械，整个健身过程充满了乐趣。并且，羽毛球运动是一项集技术和智力于一身的体育运动，他必须不断地进行判断、反应。通过羽毛球比赛，运动者可以锻炼他的控制力、耐力，养成良好的团队精神和良好的性格。','2019-12-21 10:55:53'),(3,'杨浦游泳馆新增儿童区域','幼儿期是人一生最重要、发育最快速的时期，利用这一黄金时期开展游泳活动，对孩子的身心发育大有好处。有关部门对部分4-8岁健康儿童进行游泳训练，结果证明：4至8岁是学习游泳的最佳年龄。孩子在母腹中就有屏气的本能，随着年龄的增长，屏气的本能会消退、忘记。当然，孩子太小，身体稚嫩，接受指令的能力也差，不太适宜学游泳。而4至8岁的儿童，无论从身体的状况、学习的能力、学习的兴趣上都有较大的进步，屏气的本能还未全部忘却，一经提醒容易学会。而且在学习时间上也较有保证。','2019-10-22 14:20:43'),(4,'普陀篮球场免费开放一周','很多研究表明，很多现代心理或发育疾病都来源于人的感统能力出了问题。而人在打篮球时，各种感官都在高度兴奋的状态下工作，互相配合协调。篮球运动也因此成为最佳的感统训练之一。篮球属于开放型运动技能的运动，需要运动员根据场上千变万化的瞬间去应变。久而久之，反应时间缩短，反应能力提高。提高人的决断能力和提高反应能力异曲同工。瞬息万变的球场要求一名运动员果断地做出什么时候投球，什么时候传球等等的决定。对方的优势在哪里？我们的优势在何处？如何扬长避短排出最佳阵容？这些决断能力的练习势必能够帮助一个人在日常生活中的大小决策。提高观察能力刚开始学打篮球时，教练总是会提醒我们要学会用眼睛的余光去同时观察自己负责的防守对手。其实这就是心理学上的观察能力。在日常生活中，这种对周围生活的观察能力非常重要。培养胆量和冒险精神害怕和前忧后虑往往是我们人生进取中的一大障碍，而在篮球重大比赛的紧急关头，果敢地去尝试常常是胜利的必需。','2019-12-22 18:45:33'),(5,'普陀网球场暂停开放一周','由于有内部活动需要开展，无法向公众开放一周，一周后会正常开放，敬请谅解。','2019-12-23 10:45:33'),(6,'普陀游泳馆新增亲子游玩区域','基于反馈，普陀区游泳馆新增了亲子互动的区域，该区域也配备了足够的救生员，请各位放心前往。','2019-12-23 13:30:41'),(8,'普陀区篮球馆暂停一周','普陀区篮球馆暂停一周','2019-12-23 18:22:09');

